import load from '../loader'
import { Scene } from 'dibujo'
import * as fisica from 'fisica'
import GameObject from './GameObject'
import GameManager from './GameManager'

class GameScene {

  public stage: Scene
  public world: fisica.Rect.World// = new fisica.Rect.World()
  private paused: boolean = false
  private gameObjects: Array<GameObject> = []

  constructor(manager: GameManager, configuration?) {
    this.world = new fisica.Rect.World()
    this.stage = new Scene(manager.render)
    this.stage.background = '#000000'
  }

  setBackground(background) {
    this.stage.background = background
  }

  add(gameObject): void {
    gameObject.Scene = this

    for (let component in gameObject.Components) {
      const compo = gameObject.Components[component]
      if (compo.load) {
        compo.load(gameObject, this)
      }
    }

    gameObject.run('init')
    this.gameObjects.push(gameObject)
  }

  find(property: string, value: string): Array<GameObject> {
    let found = []
    for (let gameObject of this.gameObjects) {
      if (gameObject.Identifier) {
        if (gameObject.Identifier[property] === value) {
          found.push(gameObject)
        }
      }
    }
    return found
  }

  remove(gameObject: GameObject): void {
    this.gameObjects = this.gameObjects.filter(other => {
      return gameObject.Identifier.id !== other.Identifier.id
    })
  }

  run(method: string, params?: Array<any>): void {
    for (let gameObject of this.gameObjects) {
      gameObject.run(method, params)
    }
  }

  mouseDown(manager: GameManager, mouse: Vector2D) {
    const translation = manager.gameScene.stage.translation
    this.gameObjects.forEach(gameObject => {
      if (gameObject.collider) {
        if (mouse.x > gameObject.Transform.position.x + translation.x &&
          mouse.x < gameObject.Transform.position.x + translation.x + gameObject.collider.size.x &&
          mouse.y > gameObject.Transform.position.y + translation.y &&
          mouse.y < gameObject.Transform.position.y + translation.y + gameObject.collider.size.y) {
          gameObject.run('mouseDown', mouse)
        }
      }
    })
  }


  update() {
    this.stage.clearScreen()
    this.world.update()
    this.stage.update()
    this.run('update')
  }
}

export default GameScene
